  'lines-ny':
    "/*\ntitle: Use lines to draw 1 million ny streets.\ntitleCN: 使用线图绘制近 100 万的纽约街道数据\ncategory: 'map, lines'\nshotDelay: 1000\n*/\n\nvar CHUNK_COUNT = 32;\n\nvar dataCount = 0;\n\nfunction fetchData(idx: number) {\n  if (idx >= CHUNK_COUNT) {\n    return;\n  }\n  var dataURL =\n    ROOT_PATH + '/data/asset/data/links-ny/links_ny_' + idx + '.bin';\n  var xhr = new XMLHttpRequest();\n  xhr.open('GET', dataURL, true);\n  xhr.responseType = 'arraybuffer';\n\n  xhr.onload = function (e) {\n    var rawData = new Float32Array(this.response);\n    var data = new Float64Array(rawData.length - 2);\n    var offsetX = rawData[0];\n    var offsetY = rawData[1];\n    var off = 0;\n    var addedDataCount = 0;\n    for (var i = 2; i < rawData.length; ) {\n      var count = rawData[i++];\n      data[off++] = count;\n      for (var k = 0; k < count; k++) {\n        var x = rawData[i++] + offsetX;\n        var y = rawData[i++] + offsetY;\n        data[off++] = x;\n        data[off++] = y;\n\n        addedDataCount++;\n      }\n    }\n\n    myChart.appendData({\n      seriesIndex: 0,\n      data: data\n    });\n\n    dataCount += addedDataCount;\n\n    fetchData(idx + 1);\n  };\n\n  xhr.send();\n}\n\noption = {\n  progressive: 20000,\n  backgroundColor: '#111',\n  geo: {\n    center: [-74.04327099998152, 40.86737600240287],\n    zoom: 360,\n    map: 'world',\n    roam: true,\n    silent: true,\n    itemStyle: {\n      color: 'transparent',\n      borderColor: 'rgba(255,255,255,0.1)',\n      borderWidth: 1\n    }\n  },\n  series: [\n    {\n      type: 'lines',\n\n      coordinateSystem: 'geo',\n\n      blendMode: 'lighter',\n\n      dimensions: ['value'],\n\n      data: new Float64Array(),\n      polyline: true,\n      large: true,\n\n      lineStyle: {\n        color: 'orange',\n        width: 0.5,\n        opacity: 0.3\n      }\n    }\n  ]\n};\n\nfetchData(0);\n\nexport {};\n",
