    "/*\ntitle: Custom Cartesian Polygon\ntitleCN: 自定义多边形图\ncategory: custom\ndifficulty: 3\n*/\n\nconst data: number[][] = [];\nconst dataCount = 7;\nfor (let i = 0; i < dataCount; i++) {\n  data.push([\n    echarts.number.round(Math.random() * 100),\n    echarts.number.round(Math.random() * 400)\n  ]);\n}\n\noption = {\n  tooltip: {\n    trigger: 'axis'\n  },\n  legend: {\n    data: ['bar', 'error']\n  },\n  dataZoom: [\n    {\n      type: 'slider',\n      filterMode: 'none'\n    },\n    {\n      type: 'inside',\n      filterMode: 'none'\n    }\n  ],\n  xAxis: {},\n  yAxis: {},\n  series: [\n    {\n      type: 'custom',\n      renderItem: function (params, api) {\n        if (params.context.rendered) {\n          return;\n        }\n        params.context.rendered = true;\n\n        let points: number[][] = [];\n        for (let i = 0; i < data.length; i++) {\n          points.push(api.coord(data[i]));\n        }\n        let color = api.visual('color') as string;\n\n        return {\n          type: 'polygon',\n          transition: ['shape'],\n          shape: {\n            points: points\n          },\n          style: api.style({\n            fill: color,\n            stroke: echarts.color.lift(color, 0.1)\n          })\n        };\n      },\n      clip: true,\n      data: data\n    }\n  ]\n};\n\nexport {};\n",
