  'bar-race':
    "/*\ntitle: Bar Race\ntitleCN: 动态排序柱状图\ncategory: bar\ndifficulty: 5\nvideoStart: 1000\nvideoEnd: 6000\n*/\n\nconst data: number[] = [];\nfor (let i = 0; i < 5; ++i) {\n  data.push(Math.round(Math.random() * 200));\n}\n\noption = {\n  xAxis: {\n    max: 'dataMax'\n  },\n  yAxis: {\n    type: 'category',\n    data: ['A', 'B', 'C', 'D', 'E'],\n    inverse: true,\n    animationDuration: 300,\n    animationDurationUpdate: 300,\n    max: 2 // only the largest 3 bars will be displayed\n  },\n  series: [\n    {\n      realtimeSort: true,\n      name: 'X',\n      type: 'bar',\n      data: data,\n      label: {\n        show: true,\n        position: 'right',\n        valueAnimation: true\n      }\n    }\n  ],\n  legend: {\n    show: true\n  },\n  animationDuration: 0,\n  animationDurationUpdate: 3000,\n  animationEasing: 'linear',\n  animationEasingUpdate: 'linear'\n};\n\nfunction run() {\n  for (var i = 0; i < data.length; ++i) {\n    if (Math.random() > 0.9) {\n      data[i] += Math.round(Math.random() * 2000);\n    } else {\n      data[i] += Math.round(Math.random() * 200);\n    }\n  }\n  myChart.setOption<echarts.EChartsOption>({\n    series: [\n      {\n        type: 'bar',\n        data\n      }\n    ]\n  });\n}\n\nsetTimeout(function () {\n  run();\n}, 0);\nsetInterval(function () {\n  run();\n}, 3000);\n\nexport {};\n",
